const logo_0 = "data:image/png;base64,";
const RPLogo2_1 = "data:image/png;base64,";

const styles = `
  #game-container {
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    font-family: Arial, sans-serif;
    background-color: #f9f9f9;
    height: 100%;
    text-align: center;
    padding: 20px;
    box-sizing: border-box;
  }
  #main-logo, #secondary-logo {
    max-width: 150px;
    margin: 10px;
  }
  h1 {
    font-size: 2rem;
    color: #333;
  }
  #score-display {
    font-size: 1.5rem;
    margin: 15px;
    color: #222;
  }
  #click-button {
    background-color: #3490dc;
    color: #fff;
    border: none;
    padding: 10px 20px;
    font-size: 1rem;
    border-radius: 5px;
    cursor: pointer;
    transition: background-color 0.2s;
  }
  #click-button:hover {
    background-color: #2779bd;
  }
`;

const styleSheet = document.createElement("style");
styleSheet.innerText = styles;
document.head.appendChild(styleSheet);

const container = document.getElementById("game-container");
let score = 0;

if (container) {
  const logoImg = document.createElement("img");
  logoImg.src = logo_0;
  logoImg.id = "main-logo";
  logoImg.alt = "logo.png";
  container.appendChild(logoImg);

  const rpLogoImg = document.createElement("img");
  rpLogoImg.src = RPLogo2_1;
  rpLogoImg.id = "secondary-logo";
  rpLogoImg.alt = "RPLogo2.png";
  container.appendChild(rpLogoImg);

  const title = document.createElement("h1");
  title.textContent = "Vanilla JS Clicker Game";
  container.appendChild(title);

  const scoreDisplay = document.createElement("p");
  scoreDisplay.id = "score-display";
  scoreDisplay.textContent = "Score: 0";
  container.appendChild(scoreDisplay);

  const clickButton = document.createElement("button");
  clickButton.id = "click-button";
  clickButton.textContent = "Click Me!";
  container.appendChild(clickButton);

  clickButton.addEventListener("click", () => {
    score++;
    scoreDisplay.textContent = "Score: " + score;
    if (typeof window.sendDataToGameLab === "function") {
      window.sendDataToGameLab({ event: "click", newScore: score, timestamp: new Date().toISOString() });
    }
  });
}